import { HttpClient, HttpParamsOptions } from '@angular/common/http';
import { Component, OnInit } from '@angular/core';
import { UserService } from '../services/user.service';
import { Router } from '@angular/router';

@Component({
  selector: 'app-pravi-login',
  templateUrl: './pravi-login.component.html',
  styleUrls: ['./pravi-login.component.css']
})
export class PraviLoginComponent implements OnInit {


  constructor(private http:HttpClient,private servis:UserService,private ruter:Router){}

  ngOnInit(): void {
    this.servis.getUsers().subscribe(
      imena => {
        this.korisnickaImena = imena
      }
    )
  }

  korisnicko_ime:string=''
  lozinka:string=''
  korisnickaImena:string[]=[]
  poruka:string=''
  error:string=''

  login(){
    if(!this.korisnicko_ime || !this.lozinka) {
      this.error='Niste uneli potrebne podatke'
      return
    }
    this.servis.loginVlasnik(this.korisnicko_ime,this.lozinka).subscribe(
      korisnik=>{
        if(korisnik){
          let naziv=korisnik.korisnicko_ime
          naziv=naziv==null?'':naziv
          localStorage.setItem('ulogovan',naziv)
          this.ruter.navigate(['vlasnik'])

        }
        else {
          this.servis.loginDekorater(this.korisnicko_ime,this.lozinka).subscribe(
            dekorater=>{
              if(dekorater) {
                let naziv=dekorater.korisnicko_ime
                naziv=naziv==null?'':naziv
                localStorage.setItem('ulogovan',naziv)
                this.ruter.navigate(['dekorater'])
              }
              else{
                this.error="Korisnik ne postoji u bazi ili nije prihvacen!"
              }


            }
          )
        }
      }

    )
  }


  logout(){
    localStorage.clear()
    this.ruter.navigate([''])
  }



}
<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Login Page</title>

</head>

<body>
    <table class="login-table">
        <tr>
            <td class="label-cell">
                Korisnicko ime:
            </td>
            <td>
                <input type="text" name="korisnicko_ime" [(ngModel)]="korisnicko_ime" class="input-field">
            </td>
        </tr>
        <tr>
            <td class="label-cell">
                Lozinka:
            </td>
            <td>
                <input type="password" name="lozinka" [(ngModel)]="lozinka" class="input-field">
            </td>
        </tr>
        <tr>
            <td colspan="2">
                {{error}}
            </td>
        </tr>
        <tr>
            <td colspan="2" class="button-cell">
                <button (click)="login()" class="btn">LOGIN</button>
            </td>
        </tr>
        <tr>
            <td colspan="2" class="link-cell">
                <a href="login-vlasnik" class="link">Registruj se?</a>
            </td>
        </tr>
        <tr>
            <td colspan="2" class="link-cell">
                <a href="promena-lozinke" class="link">Promeni lozinku?</a>
            </td>
        </tr>
        <tr>
            <td colspan="2" class="button-cell">
                <button (click)="logout()" class="btn">HOME</button>
            </td>
        </tr>
    </table>
</body>

</html>
